Your current approach of individually allocating device memory for data pointed to by host pointers, then updating the host struct's pointers to these device addresses, and finally copying the host struct (with updated device pointers) to the device is indeed the correct strategy for handling structs with pointers in CUDA. This method effectively performs a "deep copy."

For more complex scenarios involving multiple pointers or nested structs, you can encapsulate this logic into helper functions. This makes the code more manageable and less prone to errors. For example, you could write a function that takes a host struct and returns a device pointer to its deep-copied version, handling all internal allocations and copies.

```c++
// Example of a helper function for deep copying MyComplexStruct
// (Assumes MyData and MyComplexStruct definitions as in the previous explanation)

__host__ MyComplexStruct* deepCopyComplexStructToDevice(const MyComplexStruct& h_src) {
    // 1. Allocate device memory for data pointed to by h_src's members
    MyData* d_data_array;
    float* d_weights;
    cudaMalloc((void**)&d_data_array, h_src.size * sizeof(MyData));
    cudaMalloc((void**)&d_weights, h_src.size * sizeof(float));

    // 2. Copy actual data from host to device
    cudaMemcpy(d_data_array, h_src.data_array, h_src.size * sizeof(MyData), cudaMemcpyHostToDevice);
    cudaMemcpy(d_weights, h_src.weights, h_src.size * sizeof(float), cudaMemcpyHostToDevice);

    // 3. Create a temporary host struct (shadow struct) with device pointers
    MyComplexStruct h_dst_shadow = h_src; // Copy non-pointer members
    h_dst_shadow.data_array = d_data_array; // Update pointer to device memory
    h_dst_shadow.weights = d_weights;       // Update pointer to device memory

    // 4. Allocate device memory for the struct itself
    MyComplexStruct* d_complex_struct;
    cudaMalloc((void**)&d_complex_struct, sizeof(MyComplexStruct));

    // 5. Copy the host-side shadow struct (with device pointers) to the device
    cudaMemcpy(d_complex_struct, &h_dst_shadow, sizeof(MyComplexStruct), cudaMemcpyHostToDevice);

    // 6. Error checking (important in real code)
    // cudaCheckError();

    return d_complex_struct;
}

// And a corresponding function to free the device memory
__host__ void freeDeepCopiedComplexStructFromDevice(MyComplexStruct* d_ptr) {
    if (d_ptr == nullptr) return;

    // First, copy the struct back to host to get the device pointers
    MyComplexStruct h_temp;
    cudaMemcpy(&h_temp, d_ptr, sizeof(MyComplexStruct), cudaMemcpyDeviceToHost);

    // Free the data pointed to by the struct's members
    cudaFree(h_temp.data_array);
    cudaFree(h_temp.weights);

    // Finally, free the struct itself
    cudaFree(d_ptr);
}
